import React from "react";

const Text1 = () => {
  return (
    <>
      <h1>우리 어디가냐고 세번째 물어봅니다</h1>
      <p>
        데이트를 잘하려면 뭘 해야 할까요? <br /> 일단 애인이 있어야 합니다.
        <br /> 그 다음에 필요한 것이 바로 우리 사이트임 <br />
        제발 가입해
      </p>
    </>
  );
};

export default Text1;
